import React from "react"

const Banner = () => {
    return(
        <div className="container">
        <header style={{marginTop: '70px'}}>
         <div className="headerText">
         <div>
         <h1>Eid ke rung apno ke sung</h1>
         <p>Enjoy online shopping</p>
         </div>
         </div>
        </header>
        </div>
    )
}

export default Banner;
